import React,{useContext} from 'react';
import {Button, Col, Container, Image, Nav, Navbar} from "react-bootstrap";
import {NavLink, useNavigate} from "react-router-dom";
import {DECOR_ROUTE, MAIN_ROUTE, ORDER_ROUTE, ORDERPAGE_ROUTE, REPORT_ROUTE} from "../utils";
import {observer} from "mobx-react-lite";
import {Context} from "../index";


const MyNavBar = observer(() => {
    const {user} = useContext(Context)
    const navigate = useNavigate
    return (
        <Navbar bg="dark" variant="dark">
            <Container>
                <div className="d-flex">
                    <div className="d-flex align-items-center">
                        <div>
                            <Image width={75} src={process.env.REACT_APP_API_URL + 'icon.jpg'}/>

                        </div>
                        <div>WEAK POINT</div>
                    </div>
                    <Nav className="ml-auto" style={{color:"white", height:50}} >
                        <div className="d-flex align-items-center">
                            <NavLink
                                style={{color:"white", marginLeft:30,textDecoration:"none"}}
                                to={MAIN_ROUTE}
                            >БОКСИ
                            </NavLink>
                            <NavLink
                                style={{color:"white", marginLeft:30,textDecoration:"none"}}
                                to={DECOR_ROUTE}
                            >ДЕКОР
                            </NavLink>
                            <NavLink
                                style={{color:"white",marginLeft:30, textDecoration:"none"}}
                                to={ORDER_ROUTE}
                            >
                                ЗАМОВЛЕННЯ</NavLink>
                            <NavLink
                                style={{color:"white",marginLeft:30, textDecoration:"none"}}
                                to={REPORT_ROUTE}
                            >
                                Звіт
                            </NavLink>
                        </div>

                    </Nav>
                </div>

            </Container>
        </Navbar>
    );
}) ;

export default MyNavBar;
